import React from 'react';

const Odontograma = ({ piezas }) => {
  if (!Array.isArray(piezas)) {
    return (
      <div className="bg-white p-4 rounded-lg shadow">
        <p className="text-gray-500">Odontograma no disponible.</p>
      </div>
    );
  }

  return (
    <div className="bg-white p-4 rounded-lg shadow">
      <h3 className="text-lg font-semibold mb-2">Odontograma</h3>
      <div className="grid grid-cols-4 gap-2">
        {piezas.map((pieza, idx) => (
          <div key={idx} className="border p-2 rounded">
            <p><strong>{pieza.nombre}</strong></p>
            <p>{pieza.estado || 'Sin datos'}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Odontograma;
